import React from 'react'
import '../node_modules/bootstrap/dist/css/bootstrap.min.css'
import '../node_modules/bootstrap/dist/js/bootstrap.bundle'
import {Switch, Route, Redirect} from 'react-router-dom';
import Home from "./Home";
import Contact from "./Contact";
import About from "./About";
import Service from "./Service";
import Navbar from "./Navbar";

const App = () => {
    return (
        <div>
            <section id='header' className=''>
                <div className='container-fluid nav_bg'>
                    <div className='row'>
                        <div className='col-10 mx-auto'>
                            <div className='col-md-6 pt-5 pt-lg-0 order-2 order-lg-1'>
                                <h1>Grow your business with <strong className='brand-name'>Zensports</strong></h1>
                                <h2 className='my-2'>We are the team of talented developers making websites</h2>
                                <div className='mt-3'>
                                    <a href='www.facebook.com' className='btn-get-started'>Get Started</a>
                                </div>
                            </div>
                        </div>
                    </div>
                </div>
            </section>
            <Navbar></Navbar>
            <Switch>
                <Route exact path='/' component={Home}>Home</Route>
                <Route exact path='/about' component={About}>About</Route>
                <Route exact path='/service' component={Service}>Services</Route>
                <Route exact path='/contact' component={Contact}>Contact</Route>
                <Redirect to='/'></Redirect>
            </Switch>
        </div>
    );
}

export default App;
